import React from 'react'
import menu from './Menu'

let count = 0

const BoilerPlate = () => {
  return (
    <div>
      <h2 className="font-black text-white"></h2>
      <ul>
        {
            menu.map(item => {
                <li key={count++} className="text-white"></li>
            })
        }
      </ul>
    </div>
  )
}

export default BoilerPlate
